window.bookSummaryJSON = "<p><b>From </b><b><i>New York Times</i></b><b> best-selling author Monica Murphy comes an angsty new adult romance about the popular quarterback and the smart girl who brings him to his knees.</b></p> <p>Jake Callahan. Prince of the popular crowd.</p> <p>My mortal enemy.</p> <p>Gorgeous. All the girls want him.</p> <p>Quarterback. All the boys want to be his friend. He’s the most popular boy in the senior class.</p> <p>And he hates me.</p> <p>Or so I thought.</p> <p>What I mistook for hatred turns out to be…interest. There’s that thin line, right? It makes me crazy. I can’t stand it. Attraction, chemistry, whatever it is, I also can’t resist it.</p> <p>And neither can he.</p> <p>Together, we make no sense. The odds are against us. His friends definitely don’t approve. I’m not a part of their crowd. Not one of the cool kids. I don’t fit in, or so they say.</p> <p>But that doesn’t stop him from falling for me.</p> <p>And it won’t stop me from fighting for him.</p>"; 
